import "./App.css";
import logoSvg from "../src/images/svg/header_logo.svg";
import logoShop from "../src/images/svg/shop.svg";
import logoLike from "../src/images/svg/like.svg";
import logoAccount from "../src/images/svg/account.svg";

function App() {
  return (
    <div className="wrap">
      <header className="header__section">
        <div className="container header_container">
          <div className="header__content">
            <div className="header__logo">
              <img src={logoSvg} alt="logo" className="header__logo_svg" />
              <div className="header__logo_titles">
                <h3 className="header__logo_sub-title">REACT SNEAKERS</h3>
                <p className="header__logo_sup-title">
                  Магазин лучших кроссовок
                </p>
              </div>
            </div>
            <div className="header__shop">
              <div className="shop-wrap">
                <img src={logoShop} alt="logo" className="header__logo_svg " />
                <p className="shop-text">1205 $</p>
              </div>
              <img src={logoLike} alt="logo" className="header__logo_svg " />
              <img src={logoAccount} alt="logo" className="header__logo_svg " />
            </div>
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
